import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import ExchangeData from './components/ExchangeData';
import MetadataData from './components/MetadataData';
import CandleData from './components/CandleData';

function App() {
  return (
    <Router>
      <div>

      <nav class="navbar navbar-expand-lg navbar-light bg-light">
  <div class="container-fluid">
    <a class="navbar-brand" href="#">Navbar</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div class="navbar-nav">
        <a class="nav-link actie" aria-current="page" href="#">Home</a>
        <a class="nav-link" href="#">Features</a>
        <a class="nav-link" href="#">Pricing</a>
        <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
      </div>
    </div>
  </div>
</nav>

        {/* <nav>
          <ul>
            <li><Link to="/exchange">Exchange Data</Link></li>
            <li><Link to="/metadata">Metadata Data</Link></li>
            <li><Link to="/candle">Candle Data</Link></li>
          </ul>
        </nav> */}

        <Routes>
          <Route path="/exchange" element={<ExchangeData />} />
          <Route path="/metadata" element={<MetadataData />} />
          <Route path="/candle" element={<CandleData />} />
          <Route path="/" element={<div>Welcome to the Data App!</div>} /> {/* Default route */}
          <Route path="*" element={<div>404: Page Not Found</div>} /> {/* 404 route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
